import React from 'react';
import './App.css';
import {Link} from 'react-router-dom';

function Nav() {
  return (
    <nav>
      <h3>My Mod 5 Project Journal</h3>
      <ul className="nav-links">
          <Link to="/about">About</Link>
          <Link to="/journal">Journal</Link>
      </ul>
    </nav>
  );
}

export default Nav;
